INSERT INTO `news` VALUES (15,'2015-02-25 00:00:00','Nouveau Site B\'Sport','Nouveau Site internet avec toutes les actus et  les évènements du club.','<p>D&eacute;marrage d\'un nouveau site internet pour une pr&eacute;sentation plus d&eacute;taill&eacute;e des activit&eacute;s du club.</p>\r\n<p>Vous avez acc&egrave;s &agrave; toutes les informations et les &eacute;v&eacute;nements du club en \"temps r&eacute;el\".</p>\r\n<p>N\'oubliez pas de \"liker\" notre page Facebook !!</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/uploads/logo.png\" alt=\"\" width=\"463\" height=\"80\" /></p>'),(16,'2015-03-30 00:00:00','Nouvelle chorégraphie LESMILLS avril 2015','Le poisson d\'avril fait son show du 30 mars au 3 avril','<p><img src=\"/uploads/newsletter/poissonavril.png\" alt=\"\" width=\"465\" height=\"200\" /></p>\r\n<p>&nbsp;</p>\r\n<p>\"<strong>Les p\'tits poissons d\'avril font du sport !</strong><br /> <br /> Et oui c\'&eacute;tait l\'ouverture de la p&ecirc;che &agrave; la truite &agrave; la mi-mars... le poisson d\'avril fait son show !<br /> Pour cette occasion, la team B\'sport vous pr&eacute;sente les nouvelles chor&eacute;graphies LESMILLS.<br /> <br /> Les conditions sont simples :<br /> <br /> On veut d\'la joie, du poisson, d\'la bonne humeur et d\'la couleur !!!<br /> On veut du Pump 93 en poisson rouge parc\'qu\'il est costaud !<br /> On veut du Rpm 66 en poisson bleu parc\'qu\'il est bon !<br /> On veut du Balance 68 en poisson vert clair parc\'qu\'il est doux !<br /> On veut du Sh\'bam 19 en poisson rose parc\'qu\'il est sexy !<br /> On veut du Combat 63 en poisson vert kaki parc\'qu\'il est agile !<br /> On veut du Cxworx 18 en poisson orange parc\'qu\'il est fonctionnel !<br /> On veut d\'l\'Aquadynamic 46 et d\'l\'Aquawork 10 en maillot ben parc\'que &ccedil;a mouille !!!<br /> <br /> Rien de meilleur que d\'se sentir bien dans sa t&ecirc;te, ses pompes et son corps. Alors venez habill&eacute;s en couleur et vous deviendrez costaud, bon, doux, sexy, agile, fonctionnel et un peu tremp&eacute; !!<br /> <br /> Pour cette occasion le club B\'sport Offre 1 mois ou 4 s&eacute;ances pour tout parrainage lors de cette semaine. Alors on esp&egrave;re que la p&ecirc;che sera bonne pour vous !! Plus de renseignements et planning des relancements au port ... (l\'acceuil)<br /> <br /> En avril ne vous d&eacute;couvrez pas d?un fil ( de p&ecirc;che..), , habillez vous en couleur en fonction du cours, invitez vos proches, place &agrave; la bonne humeur. On compte sur vous<br /> <br /> Une p\'tite bavouille ! (bisous)</p>'),(17,'2015-05-04 00:00:00','STAGE DE DANCE AVEC MERYL COSTA  LE  30 MAI ','FAITES LE BUZZ \r\n','<p><img src=\"/uploads/flyer_IMP.jpg\" alt=\"\" width=\"513\" height=\"726\" /></p>');
